import React from 'react';

const Card = () => {
  return (
  	<div className>
  		<img alt='robots' src='https://robohash.org/test?size=200x200' />
	    <div>
			<h2>John Doe</h2>
	      	<p>john.doe@gmail.com</p>
	    </div>
  	</div>
  );
}

export default Card;
